import React from 'react';
import {ImagesAlb} from './ImagesAlb';
import './Galery.css';
import Album from '../Album/Album';

export default function Galery(){
    return (
      <div className='galery'>
        <div className='albcards'>
            {ImagesAlb.map((image) => {
                <Album
                image = {image.img}
                imgalt={image.id} 
                />
            })}
        </div>
      </div>
    )
  };
